import React from 'react'

const Apps = ({apps}) => {
    return (
        <div>
            <center><h1>App List</h1></center>
            {apps.map((app) => (
                <div class="card">
                    <div class="card-body">
                        <h5 class="card-title">{app.id}</h5>
                        <h6 class="card-subtitle mb-2 text-muted">{app.port}</h6>
                    </div>
                </div>
            ))}
        </div>
    )
};

export default Apps
